import styled from "styled-components";


export const Wrapper = styled.div `
	display:flex;
	font-size: 1em;
	height: 100vh;
	width: 100vw;
	text-align: center;

`;

export const Content = styled.div `
	display: flex;
	flex-direction: column;
	margin: auto;
	width: 100%;
	height: 100%;
	background-color: #3776ab;
	padding-top:2em;
	position:relative;
    .form {
      padding-bottom: 5em;
    }

`;


export const welcomeMessage = styled.div `
	flex: 1;
	margin: auto;
	width: 10%;
	height: 5%;
`;
